import { VFC } from 'react';
import Header from 'component/header/header';
import Home from 'component/home/home';
import RecordEntryForm from 'component/form/recordEntryForm';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

const App: VFC = () =>{
    return(
        <Router>
            <Header />
            <Routes>
                <Route path='/'>
                    <Home />
                </Route>
                <Route path='/entry'>
                    <RecordEntryForm />
                </Route>
            </Routes>
        </Router>
    )
}

export default App;
